【肌ラボ 極潤 UVホワイトゲルの詳細】<br>
●3つのうるおい成分を配合した、UVカット機能のあるオールインワンゲル。<br>
●みずみずしい使い心地で角質層深くまでたっぷり潤し、暑い時期のスキンケアにもおすすめです。<br>
●洗顔後、これ1つで「化粧水」「美容液」「乳液」「クリーム」「パック」、さらに「化粧下地」+「UVカット」が完了！メイクもきれいに仕上がります。<br>
●肌へのやさしさに配慮した、無香料・無着色・鉱物油フリーです。<br>
●SPF50+ PA++++。<br><br>

【使用方法】<br>
●朝、洗顔の後、適量をとり、お肌にムラなくのばしてください。<br>
●首や腕など全身のUV対策にもおすすめです。<br>
●他のスキンケアアイテムとの併用もできます。<br><br>

【ご注意】<br>
○肌に異常が生じていないかよく注意して使用すること<br>
○使用中、又は使用後日光にあたって、赤み、はれ、かゆみ、刺激、色抜け(白斑等)や黒ずみ等の異常が現れた時は、使用を中止し、皮フ科専門医等へ相談すること。そのまま使用を続けると症状が悪化することがある<br>
○傷、はれもの、湿疹、かぶれ等、異常のある部位には使用しないこと<br>
○目に入らないように注意し、入った時はすぐに水又はぬるま湯で洗い流すこと。なお、異常が残る場合は、眼科医に相談すること<br><br>

【成分】<br>
水、メトキシケイヒ酸エチルヘキシル、イソノナン酸イソノニル、ジメチコン、エタノール、BG、PEG-12ジメチコン、ペンチレングリコール、ポリシリコーン-15、ジメタクリル酸グリコールクロスポリマー、ビスエチルヘキシルオキシフェノールメトキシフェニルトリアジン、リン酸アスコルビルMg(ビタミンC誘導体)、加水分解ヒアルロン酸、ヒアルロン酸Na、ジエチルアミノヒドロキシベンゾイル安息香酸ヘキシル、ポリシリコーン-13、フェノキシエタノール、カルボマー、TEA、ポリスチレン、ポリビニルアルコール、ヒドロキシエチルセルロース、EDTA-2Na、ブチルカルバミン酸ヨウ化プロピニル、(アクリレーツ／アクリル酸アルキル(C10-30))クロスポリマー、酸化チタン、アクリレーツコポリマーアンモニウム、含水シリカ、水酸化AL、ハイドロゲンジメチコン、メチルパラベン<br><br>

