●洗顔後、1品で朝のスキンケア&UVケア完了。紫外線や乾燥などから肌をしっかりまもり、化粧ノリの違いが実感できます。<br><br>

【使用方法】<br>
洗顔のあと指先にパール粒2～3コくらいの量をとり、あご・両頬・鼻・ひたいの5カ所においてから、よくなじませるように肌にムラなくのばします。他のスキンケアアイテムと一緒に使用することもできます。<br><br>

【ご注意】<br>
○ご使用後はキャップをきちんとしめて、キャップを上にしておいてください。<br>
○高温の場所や日のあたる場所には置かないでください。<br>
○衣服についたときは、洗剤でていねいに洗ってください。また、変色(着色)する場合がありますので、塩素系の漂白剤は使用しないでください。<br>
○お肌に異常が生じていないかよく注意して使用してください。傷やはれもの・湿しん等、お肌に異常のあるときはお使いにならないでください。<br>
